import React from 'react';
import { Bar } from 'react-chartjs-2';

interface FarmGraphProps {
  data: { premiseid: string; total_animal: number }[];
}

const FarmGraph: React.FC<FarmGraphProps> = ({ data }) => {
  const chartData = {
    labels: data.map(farm => farm.premiseid),
    datasets: [
      {
        label: 'Total Animals',
        data: data.map(farm => farm.total_animal),
        backgroundColor: 'rgba(75,192,192,1)',
        borderWidth: 1,
      },
    ],
  };

  return <Bar data={chartData} />;
};

export default FarmGraph;
